// src/components/PatientRoutines.js
import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import axios from 'axios';
import {
  PieChart, Pie, Cell, Tooltip, Legend,
  BarChart, Bar, XAxis, YAxis, CartesianGrid,
  RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, Radar,
  ResponsiveContainer
} from 'recharts';
import '../styles/therapistRoutines.css';

const COLORS = ['#8884d8', '#82ca9d', '#ffc658', '#ff8042', '#0088FE'];

// Mapeos para categorizar…
const categoryMap = {
  futbol: 'Ocio', dibujos: 'Ocio', comics: 'Ocio',
  tarea: 'Obligaciones', videojuegos: 'Ocio', helado: 'Ocio',
  parque: 'Ocio', banio: 'Autocuidado', dormir: 'Autocuidado',
  musica: 'Ocio', bailar: 'Ocio', amigos: 'Ocio',
  bicicleta: 'Ocio', dibujar: 'Ocio', mascotas: 'Ocio',
  experimentos: 'Obligaciones', cantar: 'Ocio', lego: 'Ocio',
  nadar: 'Autocuidado', computadora: 'Ocio'
};
const groupMap = { Autocuidado: 'Autocuidado', Obligaciones: 'Obligaciones', Ocio: 'Ocio' };

export default function PatientRoutines() {
  const { patientId } = useParams();
  const [results, setResults] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [from, setFrom] = useState('');
  const [to, setTo] = useState('');
  const [selected, setSelected] = useState(null);
  const [metrics, setMetrics] = useState(null);

  // 1) Cargar resultados de juego
  useEffect(() => {
    const token = localStorage.getItem('token');
    axios.get(`/api/game?patientId=${patientId}`, {
      headers: { 'x-auth-token': token }
    }).then(resp => {
      setResults(resp.data);
      // filtro por defecto: últimos 7 días
      const now = new Date(), ago = new Date(now);
      ago.setDate(now.getDate() - 6);
      setFrom(ago.toISOString().slice(0,10));
      setTo(now.toISOString().slice(0,10));
    }).catch(console.error);
  }, [patientId]);

  // 2) Filtrar por fechas
  useEffect(() => {
    if (!from || !to) return;
    const f = new Date(from), t = new Date(to);
    t.setHours(23,59,59,999);
    setFiltered(
      results.filter(r => {
        const d = new Date(r.createdAt);
        return d>=f && d<=t;
      })
    );
  }, [results, from, to]);

  // 3) Selección inicial
  useEffect(() => {
    setSelected(filtered.length ? filtered[0].createdAt : null);
  }, [filtered]);

  // 4) Calcular métricas al cambiar selección
  useEffect(() => {
    if (!selected) return setMetrics(null);
    const res = filtered.find(r => r.createdAt === selected);
    if (!res) return setMetrics(null);

    // Descompón slots y actividades
    const slots = res.timeSlots || [];
    const acts = slots.flatMap(s => (s.activities || []).map(a => ({
      ...a, slot: s.slot
    })));
    const totalMin = acts.reduce((sum,a)=>sum+a.duration,0);

    // a) Distribución % por categoría
    const catSum = {};
    acts.forEach(a => {
      const cat = categoryMap[a.activityId] || 'Otros';
      catSum[cat] = (catSum[cat]||0) + a.duration;
    });
    const distribution = Object.entries(catSum).map(([name,val]) => ({
      name,
      value: +((val/totalMin)*100).toFixed(1)
    }));

    // b) Horas absolutas por categoría
    const hours = Object.entries(catSum).map(([name,val]) => ({
      name,
      hours: +(val/60).toFixed(2)
    }));

    // c) Diversidad de actividades
    const diversity = new Set(acts.map(a=>a.activityId)).size;

    // d) Consistencia diaria = % slots ocupados (24 slots)
    const covered = slots.filter(s=>s.activities?.length>0).length;
    const consistency = +((covered/24)*100).toFixed(1);

    // e) Distribución según franja horaria
    const periods = { Mañana:[6,11], Tarde:[12,17], Noche:[18,23] };
    const pdSum = { Mañana:0, Tarde:0, Noche:0 };
    acts.forEach(a => {
      const h = parseInt(a.slot.split(':')[0],10);
      for (let p in periods) {
        const [s,e] = periods[p];
        if (h>=s && h<=e) pdSum[p] += a.duration;
      }
    });
    const timeOfDay = Object.entries(pdSum).map(([name,val]) => ({
      name,
      hours: +(val/60).toFixed(2)
    }));

    // f) Balance Autocuidado/Obligaciones/Ocio
    const grpSum = { Autocuidado:0, Obligaciones:0, Ocio:0 };
    acts.forEach(a => {
      const cat = categoryMap[a.activityId]||'Ocio';
      const grp = groupMap[cat]||'Ocio';
      grpSum[grp] += a.duration;
    });
    const groupBalance = Object.entries(grpSum).map(([subject,val]) => ({
      subject,
      value: +((val/totalMin)*100).toFixed(1)
    }));

    // g) Índice global de equilibrio (simple)
    const N = distribution.length;
    const uniform = 100/N;
    const idx = 1 - (distribution.reduce((acc,c)=>acc+Math.abs(c.value-uniform),0)/200);
    const balanceIndex = +idx.toFixed(2);

    setMetrics({
      distribution, hours,
      diversity, consistency,
      timeOfDay, groupBalance,
      balanceIndex
    });
  }, [selected, filtered]);

  return (
    <div className="routines-container">
      <header className="routines-header">
        <Link to="/therapist/routines">← Volver</Link>
        <h2>Estadísticas de Rutinas</h2>
      </header>

      <section className="filter-section">
        <label>
          Desde:
          <input type="date" value={from} onChange={e=>setFrom(e.target.value)} />
        </label>
        <label>
          Hasta:
          <input type="date" value={to} onChange={e=>setTo(e.target.value)} />
        </label>
        <label>
          Día:
          <select value={selected||''} onChange={e=>setSelected(e.target.value)}>
            {filtered.map(r => {
              const d = new Date(r.createdAt).toLocaleDateString();
              return <option key={r.createdAt} value={r.createdAt}>{d}</option>;
            })}
          </select>
        </label>
      </section>

      {metrics && (
        <>
          <div className="metrics-grid">
            <div className="metric-card">
              <strong>Diversidad</strong><br/>{metrics.diversity}
            </div>
            <div className="metric-card">
              <strong>Consistencia</strong><br/>{metrics.consistency} %
            </div>
            <div className="metric-card">
              <strong>Índice Equilibrio</strong><br/>{metrics.balanceIndex}
            </div>
          </div>

          <div className="charts-grid">
            {/* Distribución % */}
            <div className="chart-block">
              <h3>Distribución % por Categoría</h3>
              <ResponsiveContainer width="100%" height={200}>
                <PieChart>
                  <Pie
                    data={metrics.distribution}
                    dataKey="value"
                    nameKey="name"
                    cx="50%"
                    cy="50%"
                    outerRadius={60}
                    label
                  >
                    {metrics.distribution.map((_, i) => (
                      <Cell key={i} fill={COLORS[i % COLORS.length]} />
                    ))}
                  </Pie>
                  <Tooltip/>
                  <Legend verticalAlign="bottom" height={36}/>
                </PieChart>
              </ResponsiveContainer>
            </div>

            {/* Horas absolutas */}
            <div className="chart-block">
              <h3>Horas por Categoría</h3>
              <ResponsiveContainer width="100%" height={200}>
                <BarChart data={metrics.hours}>
                  <CartesianGrid strokeDasharray="3 3"/>
                  <XAxis dataKey="name"/>
                  <YAxis/>
                  <Tooltip/>
                  <Bar dataKey="hours" fill="#82ca9d"/>
                </BarChart>
              </ResponsiveContainer>
            </div>

            {/* Balance de grupos */}
            <div className="chart-block">
              <h3>Balance Autocuidado/Obligaciones/Ocio</h3>
              <ResponsiveContainer width="100%" height={200}>
                <RadarChart data={metrics.groupBalance} cx="50%" cy="50%" outerRadius={60}>
                  <PolarGrid/>
                  <PolarAngleAxis dataKey="subject"/>
                  <PolarRadiusAxis angle={30} domain={[0,100]}/>
                  <Radar dataKey="value" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6}/>
                  <Tooltip/>
                </RadarChart>
              </ResponsiveContainer>
            </div>

            {/* Franja horaria */}
            <div className="chart-block">
              <h3>Horas por Franja Horaria</h3>
              <ResponsiveContainer width="100%" height={200}>
                <BarChart data={metrics.timeOfDay}>
                  <CartesianGrid strokeDasharray="3 3"/>
                  <XAxis dataKey="name"/>
                  <YAxis/>
                  <Tooltip/>
                  <Bar dataKey="hours" fill="#ffc658"/>
                </BarChart>
              </ResponsiveContainer>
            </div>
          </div>
        </>
      )}
    </div>
  );
}
